import { Header } from '../../components/Header/Header';
import { DataCard } from '../../components/DataCard/DataCard';

export function Home() {
  return (
    <Box
      sx={{
        width: '100%',
      }}
    >
      <Header />
      <Box>
        <DataCard
          title='Hey'
          data='33.1k'
        />
      </Box>
    </Box>
  );
}
